import React, { useState } from 'react';
import '../styles/style.css';
import '../styles/popup.css';
import '../styles/webfont.css';
import '../styles/info_style.css';
import '../styles/common.css';

// components/GnbHeader.js
function GnbHeader({ activeTab, onTabClick }) {
  return (
      <header>
        <nav>
          <button
              onClick={() => onTabClick('홈')}
              className={activeTab === '홈' ? 'active' : ''}
          >
            홈
          </button>
          <button
              onClick={() => onTabClick('추첨형')}
              className={activeTab === '추첨형' ? 'active' : ''}
          >
            추첨형
          </button>
          <button
              onClick={() => onTabClick('즉석 추첨형')}
              className={activeTab === '즉석 추첨형' ? 'active' : ''}
          >
            즉석 추첨형
          </button>
        </nav>
      </header>
  );
}

export default GnbHeader;
